import { Storage } from "../infrastructure/Storage";
import {
  InvlalidSessionTokenError,
  UnauthorizedError,
  UsersRepository,
} from "../infrastructure/repositories";
import { UserItem } from "../models/presentation/UserItem";
import { API } from "../infrastructure/API";
import axios from "axios";

export interface User {
  id: number;
  firstName: string;
  lastName: string;
  attribute: string;
  email: string;
}

export class FetchUsersInput {}

export class FetchUsersOutput {
  readonly users: UserItem[];

  constructor(params: { users: UserItem[] }) {
    this.users = params.users;
  }
}

export class FetchUsersUsecase {
  async fetch(): Promise<{ users: UserItem[] }> {
    try {
      const response = await axios.get(API.URL.users());
      const users = response.data.map((user: User) => ({
        id: user.id,
        firstName: user.firstName,
        lastName: user.lastName,
        email: user.email,
      }));
      return { users };
    } catch (err) {
      console.error(err);
      throw err;
    }
  }
}
